import './Nav.css';
import REturnLogo from './Logo';
import Media from 'react-media';
import { useNavigate } from 'react-router-dom';
import BarLoader from 'react-spinners/BarLoader';

// View Nav
export default function REturnNavigaTion() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {

 const navigation = useNavigate();
 const handlepath = (event) => {
  event.preventDefault();
  navigation('/sign');
 };

 return (
  <div className='wrp-nav-homed'>
   <ul>
    <REturnLogo />
    <li>Produit</li>
    <li>Commencer</li>
    <li>Pour le business</li>
    <li>Support</li>
    <li><button onClick={handlepath} className='btn-connexion'>Connexion</button></li>
   </ul>
  </div>
 );
};
export const ScreenSmall = () => {

 const navigation = useNavigate();
 const [loading, setLoading] = React.useState(false);

 const handlepath = (event) => {
  event.preventDefault();

  setLoading(true);
  setTimeout(() => {
   setLoading(false)
   navigation('/sign');

  }, 8000);

 };
 return (
  <div className='wrp-nav-homed-sm'>
   <ul>
    <REturnLogo />
    <li><button onClick={handlepath} className='Btn'>Connexion</button></li>
   </ul>
  </div>
 )
}
